import './Header.css'

function Header() {
    return(
        <div className="navbar">
            <ul>
                <li className="logo"> <svg alt="" src={require('../../assets/react.svg')}></svg> React Apps</li>
                <li>Weather info</li>
                <li>Memory Game</li>
            </ul>
        </div>
    );

}

export default Header;
